(171, '2022', 'tt16527290', ' USA,Alabama,', 'Wire Room', '3.6', 'While on wire room duty, a federal agent listens in as the target is attacked in his home by a hit squad. Without burning the wire, he must protect the investigation and the target\'s life from the confines of a room fifty miles away.', '/title/tt16527290/?ref_=nm_flmg_t_6_act', 1, 1),
(172, '2022', 'tt15837458', ' USA, Alabama,Pelham', 'Wrong Place', '3.5', 'A methamphetamines cook hunts down the former Police chief of a small town in order to silence him before he can deliver eyewitness testimony against his family, but ultimately finds himself up against more than he had bargained for.', '/title/tt15837458/?ref_=nm_flmg_t_7_act', 1, 1),
(173, '2022', 'tt14686544', ' USA, Georgia,Tifton', 'White Elephant', '4.4', 'An ex-marine enforcer must battle his conscience and code of honor when he is forced to do things for the mob.', '/title/tt14686544/?ref_=nm_flmg_t_8_act', 1, 1),
(174, '2022', 'tt14849038', ' Georgia,Eatonton,', 'Vendetta', '3.7', 'When his daughter is brutally murdered and legal justice seems unlikely, William Duncan takes the law into his own hands and sets out on a quest for retribution.', '/title/tt14849038/?ref_=nm_flmg_t_9_act', 1, 1),
(175, '2022', 'tt15391770', ' Canada, British Columbia,Vancouver', 'Corrective Measures', '4.4', 'In the world\'s most dangerous maximum security prison filled with supervillain inmates and corrupt staff, tensions rise leading to anarchy and destruction.', '/title/tt15391770/?ref_=nm_flmg_t_10_act', 1, 1),
(176, '2022', 'tt14577304', '', 'Fortress: Sniper\'s Eye', '2.9', 'Story revolves around a top-secret resort for retired U.S. intelligence officers.', '/title/tt14577304/?ref_=nm_flmg_t_11_act', 1, 1);
INSERT INTO `film` (`id`, `ANNEE`, `ID_IMDB`, `LIEU_TOURNAGE`, `NOM`, `RATING`, `RESUME`, `URL`, `ID_LANGUE`, `ID_PAYS`) VALUES
(177, '2022', 'tt14412366', ' USA, Mississippi,Jackson', 'A Day to Die', '3.5', 'Connor Connolly has one day to pay reparations to Tyrone Pettis. He is forced to ask his old military ops crew, led by Brice Mason, to come together to get him two million dollars before he loses everyone he loves in the process.', '/title/tt14412366/?ref_=nm_flmg_t_12_act', 1, 1),
(178, '2022', 'tt14174168', ' USA, Georgia,Tifton', 'Gasoline Alley', '3.9', 'A man implicated in the triple homicide of three Hollywood starlets begins his own investigation. Needing assistance, he enlists the two detectives on his tail in order to expose a conspiracy more explosive than any of them imagined.', '/title/tt14174168/?ref_=nm_flmg_t_13_act', 1, 1),
(179, '2021', 'tt13496236', ' USA, Georgia,Fitzgerald', 'American Siege', '3.4', 'An ex-NYPD officer-turned-sheriff of a small rural Georgia town has to contend with a gang of thieves who have taken a wealthy doctor hostage.', '/title/tt13496236/?ref_=nm_flmg_t_14_act', 1, 3),
(180, '2021', 'tt14577300', '', 'Fortress', '3.2', 'A group of criminals led by Robert\'s former nemesis - Balzary who hellbent on revenge, forces a retired CIA Agent and his estranged son into a high-tech bunker. Will the thick walls and defenses be powerful enough against Balzary\'s forces.', '/title/tt14577300/?ref_=nm_flmg_t_15_act', 1, 1),
(181, '2023', 'tt16280138', '', 'Magic Mike: Dernière danse', '5.2', 'Mike takes to the stage again, following a business deal that went bust, leaving him broke and taking bartender gigs in Florida. Mike heads to London with a wealthy socialite who lures him with an offer he can\'t refuse.', '/title/tt16280138/?ref_=nm_flmg_t_1_act', 1, 1),
(182, '2022', 'tt11252248', ' USA, California,Santa Clarita', 'Dog', '6.5', 'Two former Army Rangers are paired against their will on the road trip of a lifetime. Briggs (Channing Tatum) and Lulu (a Belgian Malinois) race down the Pacific Coast to get to a fellow soldier\'s funeral on time.', '/title/tt11252248/?ref_=nm_flmg_t_4_act', 1, 1),
(183, '2022', 'tt12614214', ' USA, California,Monrovia High School - 845 W. Colorado Boulevard  Monrovia', 'The Afterparty', '7.3', 'When a high school reunion\'s afterparty ends in a death, everyone is a suspect. A detective grills the former classmates one by one, uncovering potential motives as each tells their version of the story - culminating in the shocking truth.', '/title/tt12614214/?ref_=nm_flmg_t_5_act', 1, 1),
(184, '2021', 'tt6264654', ' USA, Massachusetts,Worcester', 'Free Guy', '7.1', 'When Guy, a bank teller, learns that he is a non-player character in a bloodthirsty, open-world video game, he goes on to become the hero of the story and takes the responsibility of saving the world.', '/title/tt6264654/?ref_=nm_flmg_t_6_act', 1, 1),
(185, '2021', 'tt6733874', '', 'America: Le film', '5.6', 'A chainsaw-wielding George Washington teams with beer-loving bro Sam Adams to take down the Brits in a tongue-in-cheek riff on the American Revolution.', '/title/tt6733874/?ref_=nm_flmg_t_7_act', 1, NULL),
(186, '2018', 'tt6182908', '', 'Yéti & Compagnie', '6.6', 'High up on a mountain peak surrounded by clouds, a secret Yeti society lives in peace and harmony. One day, a Yeti witnesses an airplane crash Inside lies \"Smallfoot\", a legendary creature that will rock the society to its core.', '/title/tt6182908/?ref_=nm_flmg_t_9_act', 1, 1),
(187, '2017', 'tt7699354', '', 'P!nk: Beautiful Trauma', '7.6', '\"Beautiful Trauma\" is a song by American singer-songwriter Pink. The song was written by Pink and Jack Antonoff, with production handled by Antonoff. On November 21, 2017, a music video for the song was premiered featuring actor and dancer Channing Tatum. The video features Pink and Tatum as Fred and Ginger Hart. Throughout the video, Pink vacuums, irons a shirt and s... Read all', '/title/tt7699354/?ref_=nm_flmg_t_10_act', 1, 1),
(188, '2017', 'tt4649466', ' Italy, Valle d\'Aosta,Courmayeur  Aosta', 'Kingsman: Le cercle d\'or', '6.7', 'After the Kingsman\'s headquarters is destroyed and the world is held hostage, an allied spy organization in the United States is discovered. These two elite secret agencies must band together to defeat a common enemy.', '/title/tt4649466/?ref_=nm_flmg_t_11_act', 1, 6),
(189, '2017', 'tt5439796', ' USA, Georgia,Douglasville', 'Logan Lucky', '7.0', 'Two brothers attempt to pull off a heist during a NASCAR race in North Carolina.', '/title/tt5439796/?ref_=nm_flmg_t_12_act', 1, 1),
(190, '2017', 'tt5834198', ' Romania,Bucharest,', 'Comrade Detective', '7.2', 'Parody comedy designed to resemble a non-existent gritty 1980\'s Cold War Romanian police show that promoted Communist ideals. The action-packed and blood-soaked first season finds Detectives Gregor Anghel and Joseph Baciu investigating the murder of fellow officer Nikita Ionescu and, in the process, unraveling a subversive plot to destroy their country that is fueled ... Read all', '/title/tt5834198/?ref_=nm_flmg_t_13_act', 1, 1),
(191, '2017', 'tt4116284', ' Australia, New South Wales, Moore Park  Sydney', 'Lego Batman, le film', '7.3', 'A cooler-than-ever Bruce Wayne must deal with the usual suspects as they plan to rule Gotham City, while discovering that he has accidentally adopted a teenage orphan who wishes to become his sidekick.', '/title/tt4116284/?ref_=nm_flmg_t_14_act', 1, 1),
(192, '2016', 'tt3532050', '', 'Idiotsitter', '6.4', 'A straight-and-narrow young woman is hired to babysit a mega-rich woman child who has been left alone in her daddy\'s mansion under house arrest.', '/title/tt3532050/?ref_=nm_flmg_t_15_act', 1, 1),
(193, '2023', 'tt14813150', ' USA, New York,Syracuse', 'Manodrome', '5.4', 'Conflicted about his girlfriend\'s pregnancy, Ralphie\'s life spirals out of control when he meets a mysterious family of men.', '/title/tt14813150/?ref_=nm_flmg_t_1_act', 1, 6),
(194, '2022', 'tt11527058', ' USA, New York,New York City', 'Anatomie d\'un divorce', '7.7', 'Toby Fleishman knew what to expect when he and his wife of almost 15 years separated: weekends and every other holiday with the kids, some residual bitterness, and the occasional moment of tension in their co-parenting negotiations.', '/title/tt11527058/?ref_=nm_flmg_t_2_act', 1, 1),
(195, '2021', 'tt12361974', ' Iceland,Djúpavík,', 'Zack Snyder\'s Justice League', '7.9', 'Determined to ensure that Superman\'s ultimate sacrifice wasn\'t in vain, Bruce Wayne recruits a team of metahumans to protect the world from an approaching threat of catastrophic proportions.', '/title/tt12361974/?ref_=nm_flmg_t_3_act', 1, 1),
(196, '2021', 'tt11433048', ' USA,Oklahoma,', 'Wild Indian', '5.8', 'Two men learn to confront a traumatic secret they share involving the savage murder of a schoolmate.', '/title/tt11433048/?ref_=nm_flmg_t_4_act', 1, 1),
(197, '2020', 'tt6914122', ' Czech Republic,Prague,', 'Résistance', '6.5', 'The story of mime Marcel Marceau as he works with a group of Jewish boy scouts and the French Resistance to save the lives of ten thousand orphans during World War II.', '/title/tt6914122/?ref_=nm_flmg_t_5_act', 1, 6),
(198, '2019', 'tt1560220', ' USA, Georgia,Macon', 'Retour à Zombieland', '6.7', 'Columbus, Tallahassee, Wichita, and Little Rock move to the American heartland as they face off against evolved zombies, fellow survivors, and the growing pains of the snarky makeshift family.', '/title/tt1560220/?ref_=nm_flmg_t_6_act', 1, 1),
(199, '2019', 'tt8368406', ' Ireland, County Wicklow,Ardmore Studios  Bray', 'Vivarium', '5.9', 'A young couple looking for the perfect home find themselves trapped in a mysterious labyrinth-like neighborhood of identical houses.', '/title/tt8368406/?ref_=nm_flmg_t_7_act', 1, 26),
(200, '2019', 'tt7339248', ' USA, Kentucky,Louisville', 'The Art of Self-Defense', '6.6', 'After being attacked on the street, a young man enlists at a local dojo, led by a charismatic and mysterious sensei, in an effort to learn how to defend himself from future threats.', '/title/tt7339248/?ref_=nm_flmg_t_8_act', 1, 1),
(201, '2018', 'tt8710432', ' Serbia,Belgrade,', 'Zigosani u reketu', '7.9', 'Two best friends and former basketball players are trying to re-establish their once successful basketball club. \"Zigosani u reketu\" is a nostalgic and romantic comedy about second chances, and about friendship between a Serb and a Croat.', '/title/tt8710432/?ref_=nm_flmg_t_9_act', 5, NULL),
(202, '2018', 'tt6866224', ' USA, New York,New York City', 'The Hummingbird Project', '6.2', 'A pair of high-frequency traders go up against their old boss in an effort to make millions in a fiber-optic cable deal.', '/title/tt6866224/?ref_=nm_flmg_t_10_act', 1, 3),
(203, '2017', 'tt0974015', ' Iceland, Westfjords,Djúpavík', 'Justice League', '6.1', 'Fueled by his restored faith in humanity and inspired by Superman\'s selfless act, Bruce Wayne enlists the help of his new-found ally, Diana Prince, to face an even greater enemy.', '/title/tt0974015/?ref_=nm_flmg_t_11_act', 1, 1),
(204, '2017', 'tt6817212', '', 'Rio: Match 3 Party', '6.4', 'An amazing party is happening in Rio at Carnival time. Blu (Jesse Eisenberg) and his friends Nico, Jewel, Tiny, and Pedro are ready to party. Unlock gorgeous Brazilian landscapes and prizes with your favorite characters from the hit Movie Rio.', '/title/tt6817212/?ref_=nm_flmg_t_12_act', 1, 1),
(205, '2016', 'tt3110958', ' China,Macau,', 'Insaisissables 2', '6.4', 'The Four Horsemen resurface, and are forcibly recruited by a tech genius to pull off their most impossible heist yet.', '/title/tt3110958/?ref_=nm_flmg_t_13_act', 1, 1),
(206, '2016', 'tt4513674', ' USA, California,Pasadena', 'Café Society', '6.6', 'In the 1930s, a Bronx native moves to Hollywood and falls in love with a young woman who is seeing a married man.', '/title/tt4513674/?ref_=nm_flmg_t_14_act', 1, 1),
(207, '2016', 'tt2975590', ' USA, Michigan,Detroit', 'Batman v Superman: L\'Aube de la Justice', '6.5', 'Batman is manipulated by Lex Luthor to fear Superman. Superman´s existence is meanwhile dividing the world and he is framed for murder during an international crisis. The heroes clash and force the neutral Wonder Woman to reemerge.', '/title/tt2975590/?ref_=nm_flmg_t_15_act', 1, 1);
